import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-dp-root" style="${styleMap(context.styles.wrapper)}" @keydown=${context._onkeydown} @keyup=${context._onkeyup} @click=${context._onclick} @mouseover=${context._onmouseover} @focusin=${context._onfocusin}><div id="${ifDefined(context._id)}-content" class="ui5-dp-content" role="grid" aria-roledescription="Calendar"><div role="row" class="ui5-dp-days-names-container">${ repeat(context._dayNames, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div>${ repeat(context._weeks, (item, index) => item._id || index, (item, index) => block2(item, index, context)) }</div></div>`; };
const block1 = (item, index, context) => { return html`<div role="columnheader" aria-label="${ifDefined(item.name)}" class="${ifDefined(item.classes)}">${ifDefined(item.ultraShortName)}</div>`; };
const block2 = (item, index, context) => { return html`${ item.length ? block3(item, index, context) : block8(item, index, context) }`; };
const block3 = (item, index, context) => { return html`<div style="display: flex;" role="row">${ repeat(item, (item, index) => item._id || index, (item, index) => block4(item, index, context)) }</div>`; };
const block4 = (item, index, context) => { return html`${ item.timestamp ? block5(item, index, context) : block6(item, index, context) }`; };
const block5 = (item, index, context) => { return html`<div tabindex="${ifDefined(item._tabIndex)}" ?data-sap-focus-ref="${item.focusRef}" data-sap-timestamp="${ifDefined(item.timestamp)}" role="gridcell" aria-selected="${ifDefined(item.ariaSelected)}" aria-label="${ifDefined(item.ariaLabel)}" aria-disabled="${ifDefined(item.ariaDisabled)}" class="${ifDefined(item.classes)}"><span class="ui5-dp-daytext" data-sap-timestamp="${ifDefined(item.timestamp)}">${ifDefined(item.iDay)}</span></div>`; };
const block6 = (item, index, context) => { return html`${ !item.isHidden ? block7(item, index, context) : undefined }`; };
const block7 = (item, index, context) => { return html`<div class="ui5-dp-weekname-container" role="rowheader" aria-label="Calendar Week ${ifDefined(item.weekNum)}"><span class="ui5-dp-weekname">${ifDefined(item.weekNum)}</span></div>`; };
const block8 = (item, index, context) => { return html`<div class="sapWCEmptyWeek"></div>`; };


	return block0(context);
};

export default main;
